var title_f26_35_27195="Causes of oligohydramnios";
var content_f26_35_27195=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F79447&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F79447&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of oligohydramnios",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Maternal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medical or obstetrical conditions associated with uteroplacental insufficiency (eg, preeclampsia, chronic hypertension, collagen vascular disease, nephropathy, thrombophilia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medications (eg, angiotensin converting enzyme inhibitors, prostaglandin synthetase inhibitors, trastuzumab)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Placental",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abruption",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Twin to twin transfusion (ie, twin polyhydramnios-oligohydramnios sequence)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Placental thrombosis or infarction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Fetal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chromosomal abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenital abnormalities, especially those associated with impaired urine production",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Growth restriction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Demise",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Postterm pregnancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ruptured fetal membranes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Idiopathic",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
