var title_f26_35_27196="Lesion-specific characteristics and outcome after balloon angiop";
var content_f26_35_27196=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Lesion-specific characteristics and outcome after balloon angioplasty",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Type A lesions- high success (&gt;85 percent); low risk",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Discrete, &lt;10 mm in length",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Concentric",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Readily accessible",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Nonangulated segment, &lt;45&deg;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Smooth contour",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Little or no calcification",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Less than totally occlusive",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Not ostial in location",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       No major branch involvement",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Absence of thrombus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Type B lesions- moderate success (60 to 85 percent); moderate risk (Type B1 - one type B characteristic; Type B2 - more than one type B characteristic)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tubular, 10 to 20 mm in length",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Eccentric",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Moderate tortuosity of proximal segment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Moderately angulated segment (&gt;45&deg;, &lt;90&deg;)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Irregular contour",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Moderate to heavy calcification",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Total occlusions less than three months old and/or bridging collaterals",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ostial in location",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bifurcation lesions requiring double guide wires",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Some thrombus present",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Type C lesions- low success (&lt;60 percent); high risk",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Diffuse, &gt;20 mm in length",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Excessive tortuosity of proximal segment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Extremely angulated segments &gt;90&deg;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Total occlusion  more than three months old",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inability to protect major side branches",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Degenerated vein grafts with friable lesions",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Although the risk of abrupt vessel closure is moderate, in certain instances the likelihood of a major complication may be low with dilation of total occlusions less than three months old or when abundant collateral channels supply the distal vessel.",
"    </div>",
"    <div class=\"reference\">",
"     From Ryan TO, Axon DP, Gunnar RM, et al. J Am Coll Cardiol 1988; 12:529.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
